import React, {Component} from 'react'
import UserLoggedTabs from '../layout/UserLoggedTabs';
import ReactDOM from 'react-dom';
import axios from 'axios';
import { NavLink } from "react-router-dom";
import "../layout/navbarLinks/navBarLinks.css";

class PrijavaKorisnika extends Component
{
    render()
    {
        return(
            <div className="container">
                <h3>Prijavite se..</h3>
                <h4>Nemate nalog?</h4>
                <NavLink style={{height: 10 + 'em'}} to="/registracijaKorisnika">Registrujte se besplatno</NavLink>
                <form className="white">
                    <div className="input-field">
                        <label htmlFor="username">Korisnicko ime:</label>
                        <input type="text" id='username' />
                    </div>
                    <div className="input-field">
                        <label htmlFor="pass">Lozinka:</label>
                        <input type="password" id='pass' />
                    </div>
                    <input type="submit" value="Prijava"/>
                </form>
                
            </div>
        );
    }
}

export default PrijavaKorisnika
